When I opened the gate to Bennie’s backyard, I was blown away by the village of Traeger community members who flew in from all around the country on their own dime to celebrate Traeger Day 2023 together.  Friendships that have been built and nurtured on the common bond of cooking, sharing and connecting. Supporting one another and enjoying some great moments together. I met some friends for the first I had only known over social media.  One of my favorite days as a member of the Traegerhood! 

Thank you @kendrick_bbq for bringing us together!

