Life changing weekend with my boys at BYU fathers & sons camp over the holiday weekend. Slept in the dorms. Ate in the cafeteria. Played every sport imaginable in venues I grew up dreaming of playing in. Joined at the hip with my boys was a bonding experience like no other we’ve had in their first seven years of life. They were in heaven. I was in heaven. Already thinking about next year! 

Such a great lesson (which I tend to learn over and over) of the joy of putting everything down and being present with the ones I love. 💙💙

